import React from 'react';
import Axios from 'axios';

class DeveloperinProject extends React.Component{
    constructor(props){
        super(props);
        this.state={data:[],err:0,name:""}
        Axios.get(`http://localhost:3002/getdeveloperinproject/${this.props.id}`).then(res=>{
            this.setState({data:res.data.developers})

            })
    }

    shouldComponentUpdate(nextprops,nextstate){
        if(this.state.name!==nextstate.name)
            return false;
        else
            return true;
    }

    render(){
        console.log(this.state.data)
        const developers=this.state.data.map(i=>{
            Axios.get(`http://localhost:3002/developerdetail/${i}`).then(res=>{
                return(
                    <div style={{textAlign:'center',border:'1px solid black',width:'fit-content',height:'fit-content'}}>
                        <h6>{res.data.name}</h6>
                    </div>
                )
            })

        })
        return(
           <h1>{developers}</h1>
        )
    }
}
export default DeveloperinProject;
